import React from 'react'
import search from '../../img/search.png'
const MySearch = ({value,onChange,event}) => {
  return (
    <div className='mySearch__block'><input value={value} onChange={event => onChange(event.target.value)} placeholder='Search' className='mySearch' type="text" /></div> 
  )
}

export default MySearch
